    "sellingByWeight": true,
    "weightOfPrice": "1.0",
    "description": "<p>Грудки нашей фермерской индейки – диетический продукт. Идеально подходят для жарки, запекания и как ингредиент для салатов и других сложных блюд.</p><p>Индейка выращена на вольном выпасе в нашем собственном хозяйстве «Честная ферма» в экологически чистом Спасском районе Рязанской области в деревне Выжелес.</p><p>Для прокорма птицы использовались только натуральные корма – собственная травка, собственное сено, зерно, и никакой химии! Наши птицы получают хороший уход, они здоровы, поэтому нам не нужно использовать антибиотики, как это делают на крупных промышленных птицефабриках.</p><p>В течении суток после забоя индейка попадает на склад в Москву в охлажденном виде, где в тот же день происходит разделка тушек и отправка продукта по нашим клиентам. Упаковка - компактный пластиковый контейнер, который очень удобен для хранения и домашней заморозки.</p>",
